// HomePage.jsx
import React, { useState } from 'react';
import { Package, Star, Calendar } from 'lucide-react';
import { useNavigate } from 'react-router-dom';
import { categories } from '../data/categories';
import FeaturedProducts from '../components/products/FeaturedProducts';
import EventPreview from '../components/events/EventPreview';

const HomePage = () => {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(false);

  const checkAuthAndRedirect = async (role) => {
    setLoading(true);
    try {
      const response = await fetch(`/api/auth/check/${role}`, {
        method: 'GET',
        credentials: 'include',
        headers: {
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        if (data.authenticated) {
          navigate(`/${role}-dashboard`);
        } else {
          navigate(`/auth/${role}-registration`);
        }
      } else {
        throw new Error('Authentication check failed');
      }
    } catch (error) {
      console.error('Auth check error:', error);
      navigate('/login');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Hero Section */}
      <div className="relative bg-white overflow-hidden">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center py-16">
            <h1 className="text-4xl font-bold text-gray-900">
              Connect with Top Manufacturers & Distributors
            </h1>
            <p className="mt-4 text-xl text-gray-500">
              Duty Dinar brings businesses and suppliers together in one powerful B2B platform
            </p>
            <div className="mt-8 flex justify-center gap-4">
              <button
                onClick={() => checkAuthAndRedirect('buyer')}
                disabled={loading}
                className="px-6 py-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
              >
                {loading ? 'Please wait...' : 'Start Buying'}
              </button>
              <button
                onClick={() => checkAuthAndRedirect('seller')}
                disabled={loading}
                className="px-6 py-3 bg-green-600 text-white rounded-lg hover:bg-green-700 transition-colors"
              >
                {loading ? 'Please wait...' : 'Become a Seller'}
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Quick Stats */}
      <div className="bg-white py-12">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="grid grid-cols-4 gap-8">
            <div className="text-center">
              <div className="text-3xl font-bold text-blue-600">5000+</div>
              <div className="text-gray-600">Verified Suppliers</div>
            </div>
            <div className="text-center">
              <div className="text-3xl font-bold text-blue-600">50k+</div>
              <div className="text-gray-600">Products Listed</div>
            </div>
            <div className="text-center">
              <div className="text-3xl font-bold text-blue-600">100k+</div>
              <div className="text-gray-600">Business Buyers</div>
            </div>
            <div className="text-center">
              <div className="text-3xl font-bold text-blue-600">30+</div>
              <div className="text-gray-600">Countries</div>
            </div>
          </div>
        </div>
      </div>

      {/* Categories */}
      <div className="py-12">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <h2 className="text-3xl font-bold text-center mb-8">Browse Categories</h2>
          <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
            {categories.map(({ name, icon: Icon, gradient }) => (
              <div
                key={name}
                className="p-6 rounded-lg shadow-sm hover:shadow-md transition-shadow cursor-pointer"
                style={{ background: gradient }}
              >
                <Icon className="w-8 h-8 mb-3 text-white" />
                <h3 className="text-lg font-semibold text-white">{name}</h3>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Featured Products */}
      <FeaturedProducts />

      {/* Events Preview */}
      <EventPreview />
    </div>
  );
};

export default HomePage;
